import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from './pages/Home/Home/Home';
import Appoinment from './pages/Appointment/Appoinment/Appoinment';
import Login from './pages/Login/Login';
function App() {
  const cardDistribution = (users) => {
    let n = 0;
    users.map(user => {
      let districtFirstTwo = user.district.slice(0, 2).toUpperCase();
      let currentYcarLastTwo = user.currentYear.toString().slice(-2);
      let postalFirstTwo = user.postNo.toString().slice(0, 2);
      // let postalFirstTwo = user.birthYear.slice(0, 2);
      // let serialNumber = String(n + 1).padStart(6, '0');
      console.log(districtFirstTwo + currentYcarLastTwo + postalFirstTwo+user);
    })
  }

  let users = [{ name: "Mr Rashad", birthYear: 1999, currentYear: 2022, district: "Dhaka", postNo: 1208, priority: 2 },
  { name: "Mr Raju", btrthYear: 1995, currentYear: 2022, district: "Rajshahi", postNo: 1211, priority: 1 }
  ];
  cardDistribution(users);


  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/appoinment">
            <Appoinment />
          </Route>
          <Route path="/home">
            <Home />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
          <Route exact path="/">
            <Home />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
